import React from 'react';
import currStories1 from '../../icons/myphoto1.png';
import './CurrentStories.scss';

const CurrentStories = ({ activeStories }) => {
  return (
    <div className="current-stories-wrapper">
      <div className="current-stories-inner">
        <canvas
          height="174"
          width="174"
          style={{ position: 'absolute', top: '-5px', left: '-5px', width: '87px', height: '87px' }}
        >
          <img
            className={activeStories ? 'current-stories' : 'current-stories active'}
            src={currStories1}
            alt="current-stories"
          />
        </canvas>
      </div>
      <span className="current-stories-text">my</span>
    </div>
  );
};

export default CurrentStories;
